def is_interleaved(s1, s2, s3):
    memo = {}

    def dp(i, j):
        if (i, j) in memo:
            return memo[(i, j)]

        if i == len(s1) and j == len(s2):
            return s3[i+j] == s3[len(s1)+len(s2)]

        if i < len(s1) and s1[i] == s3[i+j] and dp(i+1, j):
            memo[(i, j)] = True
            return True

        if j < len(s2) and s2[j] == s3[i+j] and dp(i, j+1):
            memo[(i, j)] = True
            return True

        memo[(i, j)] = False
        return False

    return dp(0, 0)
