def isScramble(s1: str, s2: str) -> bool:
    if len(s1) != len(s2):
        return False
    if sorted(s1) != sorted(s2):
        return False
    memo = {}

    def dfs(i, j, n):
        key = (i, j)

        if key in memo:
            return memo[key]

        if i == n or j == n:
            return True

        for k in range(1, n - 1):
            if (dfs(i, j + k, n) and dfs(i + k, j, n)) or (dfs(i, j + k, n) and dfs(i + k, j + n - k, n)):
                memo[key] = True
                return True

        memo[key] = False
        return False

    return dfs(0, 0, len(s1))
```

