def binary_search(arr, target):
    left = 0
    right = len(arr) - 1

    while left <= right:
        mid = (left + right) // 2

        if arr[mid] == target:
            return True

        if arr[mid] == arr[left]:
            left += 1
        elif arr[mid] > arr[left]:
            if target >= arr[left] and target <= arr[mid]:
                right = mid - 1
            else:
                left = mid + 1
        else:
            if target >= arr[mid] and target <= arr[right]:
                left = mid + 1
            else:
                right = mid - 1

    return False

