def mark_zeros(matrix):
    m, n = len(matrix), len(matrix[0])

    # Step 1: Initialize flag variables for rows and columns
    first_row_zero = False
    first_col_zero = False

    # Step 2: Iterate over the matrix to mark zeros in rows and columns
    for i in range(m):
        for j in range(n):
            if matrix[i][j] == 0:
                if j == 0:
                    first_col_zero = True
                if i == 0:
                    first_row_zero = True
                matrix[0][j] = -1
                matrix[i][0] = -1

    # Step 3: Iterate over the matrix, ignoring the first row and column
    for i in range(1, m):
        for j in range(1, n):
            if matrix[0][j] == -1 or matrix[i][0] == -1:
                matrix[i][j] = 0

    # Step 4: Set the first row and column to zero if their flags are set
    if first_row_zero:
        for j in range(n):
            matrix[0][j] = 0
    if first_col_zero:
        for i in range(m):
            matrix[i][0] = 0

    return matrix

