def unique_paths(grid):
    m, n = len(grid), len(grid[0])

    if grid[0][0] == 1:
        for i in range(1, m):
            if grid[i][0] != 1 or grid[i-1][0] != 1: break
            grid[i][0] = 1

        for j in range(1, n):
            if grid[0][j] != 1 or grid[0][j-1] != 1: break
            grid[0][j] = 1

    for i in range(1, m):
        for j in range(1, n):
            if grid[i][j] == 1:
                grid[i][j] = grid[i-1][j] + grid[i][j-1]

    return grid[-1][-1]

