def spiralOrder(matrix):
    if not matrix:
        return []

    rows, cols = len(matrix), len(matrix[0])
    result = [[0]*cols for _ in range(rows)]
    top, bottom, left, right = 0, rows-1, 0, cols-1

    direction = 'right'

    while True:
        if direction == 'right':
            for i in range(left, right+1):
                result[top][i] = matrix[top][i]
            top += 1
            if top > bottom:
                break
            direction = 'down'

        elif direction == 'down':
            for i in range(top, bottom+1):
                result[i][right] = matrix[i][right]
            right -= 1
            if left > right:
                break
            direction = 'left'

        elif direction == 'left':
            for i in range(right, left-1, -1):
                result[bottom][i] = matrix[bottom][i]
            bottom -= 1
            if top > bottom:
                break
            direction = 'up'

        elif direction == 'up':
            for i in range(bottom, top-1, -1):
                result[i][left] = matrix[i][left]
            left += 1
            if left > right:
                break
            direction = 'right'

    return result

