def solve_n_queens(n):
    def is_safe(cols, row, col):
        for i in range(len(cols)):
            if cols[i] == row or abs(i - col) == abs(cols[i] - row):
                return False
        return True

    def backtrack(cols, row):
        if len(cols) == n:
            nonlocal count
            count += 1
            return
        for col in range(n):
            if is_safe(cols, row, col):
                cols.append(col)
                backtrack(cols, row + 1)
                cols.pop()

    count = 0
    backtrack([], 0)
    return count


