def is_match(s: str, p: str) -> bool:
    m, n = len(s), len(p)
    i, j = 0, 0
    asterisk, match = -1, 0

    while i < m:
        if p[j] == s[i] or p[j] == '?':
            i += 1
            j += 1
        elif p[j] == '*':
            match = i
            asterisk = j
            j += 1
        else:
            if asterisk != -1 and (p[asterisk] == '?' or p[asterisk] == s[i]):
                match = i + 1
                i = match
                j = asterisk + 1
            elif i <= match:
                return False
            else:
                match, i, j = i, i + 1, j

        if j >= n:
            break

    for k in range(j, n):
        if p[k] == '*':
            continue
        elif p[k] != s[m - (n - k)] and p[k] != '?':
            return False

    return True

