def multiply(num1: str, num2: str):
    pos = [0] * (len(num1) + len(num2))
    for i in range(len(num1)):
        for j in range(len(num2)):
            pos[i + j] += int(num1[-(i+1)]) * int(num2[-(j+1)])
    for i in range(len(pos) - 1):
        if pos[i] >= 10:
            carry = pos[i] // 10
            pos[i] %= 10
            pos[i + 1] += carry
    res = ''
    while len(res) < len(num1) + len(num2) and pos[-(len(res)+1)] == 0:
        res = '0' + res
    for i in range(len(pos)-1, -1, -1):
        if pos[i] > 9 or len(res) != (len(num1) + len(num2)) - i:
            res += str(pos[i])
    return res.lstrip('0') or '0'
