def container_water(elevation_map):
    if not elevation_map:
        return 0

    n = len(elevation_map)

    left, right = 0, n - 1
    max_left, max_right = elevation_map[0], elevation_map[n-1]
    water = 0

    while left < right:
        if elevation_map[left] < elevation_map[right]:
            if elevation_map[left] >= max_left:
                max_left = elevation_map[left]
            else:
                water += (max_left - elevation_map[left]) * (left - right)
            left += 1
        else:
            if elevation_map[right] >= max_right:
                max_right = elevation_map[right]
            else:
                water += (max_right - elevation_map[right]) * (right + 1)
            right -= 1

    return water

