def find_index(nums):
    seen = set()

    for i in range(len(nums)):
        if 1 <= nums[i] <= len(nums) and nums[i] not in seen:
            seen.add(nums[i])
            nums[nums[i] - 1], nums[i] = nums[i], nums[nums[i] - 1]

    for i in range(len(nums)):
        if nums[i] != i + 1:
            return i + 1

    return len(nums) + 1
