def is_valid(board, row, col, num):
    # check if the number already exists in the row or column
    for x in range(9):
        if board[row][x] == str(num) or board[x][col] == str(num):
            return False

    # check if the number exists in its 3x3 grid
    start_row, start_col = row - row % 3, col - col % 3
    for i in range(3):
        for j in range(3):
            if board[i + start_row][j + start_col] == str(num):
                return False

    return True


