def longestValidParentheses(s):
    stack = []
    max_length = 0

    for i, c in enumerate(s):
        if c == '(':
            stack.append(i)
        else:
            if len(stack) > 0:
                stack.pop()
                if not stack:
                    max_length = max(max_length, i + 1)
                else:
                    max_length = max(max_length, i - stack[-1])
            else:
                stack.append(i)

    return max_length
