def nextPermutation(nums):
    n = len(nums)

    # Find peak index k from right to left
    for k in range(n - 1, 0, -1):
        if nums[k] > nums[k - 1]:
            break

    # If no such k exists, the permutation is sorted in descending order,
    # so we just need to reverse the array.
    else:
        return nums[::-1]

    # Find largest index l greater than k such that nums[k] < nums[l]
    for l in range(n - 1, k, -1):
        if nums[l] > nums[k]:
            break

    # Swap value of nums[k] with that of nums[l]
    nums[k], nums[l] = nums[l], nums[k]

    # Reverse the sub-array nums[k + 1:]
    for i in range(n - 1, k, -1):
        nums[i], nums[i - 1] = nums[i - 1], nums[i]

    return nums
