from collections import defaultdict

def findSubstring(s, words):
    if not s or not words:
        return []

    word_count = defaultdict(int)
    for word in words:
        word_count[word] += 1

    word_length, total_words, total_length = len(words[0]), len(words), sum(len(word) for word in words)

    result = []
    for i in range(len(s) - total_length + 1):
        temp_word_count = defaultdict(int)
        for j in range(total_words):
            if (i + j * word_length >= len(s)):
                break
            word = s[i + j * word_length:i + (j+1) * word_length]
            if word not in word_count:
                break
            if temp_word_count[word] < word_count[word]:
                temp_word_count[word] += 1
            else:
                break
        else:
            result.append(i)

    return result
