# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

class Solution:
    def mergeKLists(self, lists):
        if not lists:
            return None

        while len(lists) > 1:
            merged_lists = []

            for i in range(0, len(lists), 2):
                if i + 1 < len(lists):
                    merged_list = self.merge2Lists(lists[i], lists[i+1])
                    merged_lists.append(merged_list)
                else:
                    merged_lists.append(lists[i])

            lists = merged_lists

        return lists[0]

    def merge2Lists(self, l1, l2):
        if not l1:
            return l2
        elif not l2:
            return l1

        if l1.val < l2.val:
            l1.next = self.merge2Lists(l1.next, l2)
            return l1
        else:
            l2.next = self.merge2Lists(l1, l2.next)
            return l2

