def findClosestSum(nums, target):
    nums.sort()
    closest = sum(nums[:3])

    for i in range(len(nums) - 3):
        left, right = i + 1, len(nums) - 1

        while left < right:
            cur_sum = nums[i] + nums[left] + nums[right]

            if cur_sum == target:
                return cur_sum

            closest = min(closest, abs(target - cur_sum))

            if cur_sum < target:
                left += 1
            else:
                right -= 1

    return closest

# Example usage
print(findClosestSum([0,1,2,3,4,5], 10)) # Output: 10.0
