def int_to_roman(lst):
    roman_numerals = {
        1000: 'M', 900: 'CM', 500: 'D', 400: 'CD',
        100: 'C', 90: 'XC', 50: 'L', 40: 'XL',
        10: 'X', 9: 'IX', 5: 'V', 4: 'IV', 1: 'I'
    }

    result = []
    num = lst[0][0]
    for decimal, roman in sorted(lst, reverse=True):
        while num >= decimal:
            result.append(roman)
            num -= decimal

    return ''.join(result)


