def parse_int(s):
    result = 0
    i = 0
    sign = 1

    while i < len(s) and s[i] == ' ':
        i += 1

    if i < len(s) and (s[i] == '+' or s[i] == '-'):
        if s[i] == '-':
            sign = -1
        i += 1

    while i < len(s):
        if s[i].isdigit():
            result = result * 10 + int(s[i])
            i += 1
        else:
            break

    if result > 2**31 - 1 or result < -2**31:
        return -2147483648 if sign == -1 else 2147483647

    return result * sign
```

